const axios = require('axios');

const data = [
    {
      "image": "",
      "label": "Guava dot"
    },
    {
      "image": "",
      "label": "Rice bacterial leaf blight"
    },
    {
        "image" : "",
        "label": "Coffee miner"
    },
    {
        "image": "",
        "label": "Mango powdery mildew"
    },
    {
        "image": "",
        "label": "Rice leaf blast"
    },
    {
        "image": "",
        "label": "Coffee miner"
    }
    // Tambahkan data lainnya di sini
  ];
  
  const endpoint = 'http://127.0.0.1:5000/predict';
  
  const requests = data.map((item, index) => {
    return axios.post(endpoint, item)
      .then(response => {
        console.log(`Request ${index + 1} - Label: ${item.label}`);
        console.log(`Request ${index + 1} - Response:`, response.data);
  
        // Validasi respons sesuai label
        const prediction = response.data.prediction;
        if (prediction === item.label) {
          console.log("Prediksi benar!");
        } else {
          console.error(`Prediksi salah! Harapan: ${item.label}, Hasil: ${prediction}`);
        }
        return response; // Kembalikan respons untuk Promise.all
      })
      .catch(error => {
        console.error(`Error sending request ${index + 1}:`, error);
        return Promise.reject(error); // Kembalikan Promise.reject untuk menghentikan Promise.all
      });
  });
  
  Promise.all(requests)
    .then(responses => {
      console.log('Semua request berhasil!');
      // Proses respons dari semua request (jika diperlukan)
    })
    .catch(error => {
      console.error('Terjadi kesalahan pada salah satu request:', error);
    });